    <script>
        function filterSelection() {
            const location = document.getElementById('gameLocationSelector').value;
            const clothingType = document.getElementById('clothingTypeSelector').value;
            const buttons = document.querySelectorAll('#homeContent .button-container button');
            
            buttons.forEach(button => {
                let showByLocation = (location === 'all' || button.classList.contains(location));
                let showByClothingType = (clothingType === 'all' || button.classList.contains(clothingType));
                
                if (location !== "" && clothingType !== "" && showByLocation && showByClothingType) {
                    button.style.display = 'block';
                } else {
                    button.style.display = 'none';
                }
            });
        }
